Static variables are those variables that are declared with the static keyword. They are initialized only once at compile time and they retain their values between different function calls. Static variables are stored in the initialized data segment of the memory.
Static variables can be either internal or external. Internal static variables are those that are declared inside a block or a function. They are not accessible from outside the block or function. External static variables are those that are declared outside all functions. They are accessible from all the functions in the file but not from other files.
Register variables are those variables that are declared with the register keyword. They are stored in the CPU registers instead of the memory. This makes the access to these variables faster. However, only a limited number of variables can be declared as register variables because the number of CPU registers is limited.
The register keyword is just a request to the compiler to store the variable in a CPU register. The compiler may or may not fulfill this request depending on the availability of CPU registers.
Here is an example of static and register variables in C:
```
#include <stdio.h>

void func() {
    static int x = 10; // internal static variable
    register int y = 20; // register variable
    printf("%d %d\n", x, y);
    x++;
    y++;
}

int main() {
    static int z = 30; // external static variable
    printf("%d\n", z);
    func();
    func();
    return 0;
}
```
